import React, { Component } from "react";
import Modal from './Modal'

class Settings extends Component {

    state = {
        show: false
      };
      showModal = e => {
        this.setState({
          show: true
        });
      };
    
    render() {
      return (
        <Modal show={this.state.show} />
      )

    }
  }

export default Settings;
